import React from 'react'

function AboutUs() {
    return (
        <div>
           <h1>About US</h1>
          <section>
          <p>RUCHI is a non-political, non-profit organisation committed to the development of rural India. RUCHI began in October 1980 in a remote village in Chopal in the Shimla District. It was registered under The Societies Registration Act of 1860 in 1983, and its headquarters are now located at Bandh, a small village in the Himalayan foothills of Himachal Pradesh State, 
           Northern India. RUCHI is now working in over 100 villages in the steep mountainous terrain of the Sirmour and Solan districts.</p>
          </section>
        </div>
    )
}

export default AboutUs
